import React from "react";
import { Routes } from "react-router-dom";

import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Home from "./Home";

const App = () => {
  // const Name = () => {
  //   return <h1>Hello, This is name page</h1>;
  // };
  return (
    <>
      <Routes>
      <Route path="/" element={<Home />} />
      </Routes>
    </>
  );
};

export default App;
